import React from "react";
import classes from "../json/Classes.json"
import "./styles/ReferencesPage.css"
import { Link } from "react-router-dom";

const ClassesPage = () => {

    const headerRow = () => {
        return (
            <tr>
                <th>Class</th>
                <th>HP</th>
                <th>STR</th>
                <th>MAG</th>
                <th>DEX</th>
                <th>SPD</th>
                <th>DEF</th>
                <th>RES</th>
                <th>LCK</th>
                <th>BLD</th>
            </tr>
        )
    }
    return (
        <main className="referenceMain">
            <h2>Class Reference</h2>
            <table className="referenceList">
                <thead>
                    {headerRow()}
                </thead>
                <tbody>
                    {classes.map((character, index) => {
                        return (
                            <>
                                {index % 20 === 0 && index !== 0 ? headerRow(): ""}
                                <tr>
                                    <th>{character.name}</th>
                                    <td>{character.hp}</td>
                                    <td>{character.str}</td>
                                    <td>{character.mag}</td>
                                    <td>{character.lck}</td>
                                    <td>{character.dex}</td>
                                    <td>{character.spd}</td>
                                    <td>{character.def}</td>
                                    <td>{character.res}</td>
                                    <td>{character.bld}</td>
                                </tr>
                            </>
                        )
                    })}
                </tbody>
            </table>
            <p>This page is for general referencing only. Go to <Link to="/calculator">Calculator</Link> for calculations.</p>
        </main>
    )
}

export default ClassesPage
